void updateLcdFunction(){
  lcd.setCursor(0,1);
  switch(type){
    case 0:
      lcd.print("Square Wave");
      break;
    case 1:
      lcd.print("Sinusoid    ");
      break;
    case 2:
      lcd.print("Triangle     ");
      break;
  }
}

void updateLcdFrequency(){
  lcd.setCursor(0,0);
  lcd.print(output);
  lcd.print(frequency);
  lcd.print("    ");
}

void freqCalc(){
  if (frequency < 25){
    range = 0;
  }
  else if (frequency < 250){
    range = 1;
  }
  else{
    range = 2;
  }
  triInc = 255.0/double(samplerate);
  sinIndex = (samplerate%frequency)/frequency;
  updateLcdFrequency();
}

bool buttonRead(){
  buttState = digitalRead(BUTTON);
  if (buttState == LOW){
    type += 1;
    type = type%3;
    oldButtState = buttState;
    delay(300);
    return true;
  }
  else{
    return false;
  }
}

void getFreq(){
  bool changing = true;
  while (changing){
    oldaState = aState;
    if (digitalRead(ENCB) != aState){ // a changes to stop matching b when clockwise, freq++
      switch(range){
        case(0):
          frequency = frequency + 1;
          break;
        case(1):
          frequency = frequency + 5;
          break;
        case(2):
          frequency = frequency + 10;
          break;
      }
      if (frequency > 5000){
        frequency = 5000;
      }
    }
    else{ // counterclockwise, freq--
      switch(range){
        case(0):
          frequency = frequency - 1;
          break;
        case(1):
          frequency = frequency - 5;
          break;
        case(2):
          frequency = frequency - 10;
          break;
      }
      if (frequency < 1){
        frequency = 1;
      }
    }
    freqCalc();
    aState = digitalRead(ENCA);
    if (aState == oldaState){
      changing = false;
    }
  }
}

void holdInts(){
  TCCR1A = 0;// set entire TCCR1A register to 0
  TCCR1B = 0;// same for TCCR1B
}
void setInts(){
//timer 1 controls sample output @ 100kHz
  holdInts();
  
  TCCR1B = 0;
  //turn on CTC mode and
  // Set CS10 bit for 0 prescaler
  TCCR1B |=  (1 << WGM12); 
  TCCR1B |=  (0 << CS10);
  TCCR1B |=  (1 << CS11);
  // enable timer compare interrupt
  TIMSK1 |= (1 << OCIE1A); 
  // enable overflow interrupt
  
  //set compare match register- 100khz for output sampling
  OCR1A = 19; // = (16 000 000 / 100 000) - 1 = 159
  TCNT1 = 0;
}

void setup()
{
  //initialize variables
  pinMode(BUTTON, INPUT_PULLUP);
  pinMode(ENCA, INPUT_PULLUP);
  pinMode(ENCB, INPUT_PULLUP);
  
  oldButtState = digitalRead(BUTTON);
  oldaState = digitalRead(ENCA);
  
  
  lcd.setBacklightPin(3,POSITIVE);
  lcd.setBacklight(HIGH); // NOTE: You can turn the backlight off by setting it to LOW instead of HIGH
  lcd.begin(16, 2);
  
  delay(15);
  
    //set port/pin  mode
  DDRD = 0xFF; //all outputs on port D (digital 0-7)
  PORTD = 0xFF;

  //TIMER INTERRUPT SETUP
  
  cli();
  holdInts();
  sei();
  updateLcdFunction();
  delay(10);
  freqCalc();
  delay(10);
  cli();
  setInts();
  sei();
  
}

  // calculate sinIndex here
byte newAnalogValue(){
  switch (type){
    case 0: // square wave
      if (quadrant < 2){
        return 0xFF;
      }
      else{
        return 0x00;
      }
      break;
    case 1: // sine
      switch (quadrant){
        case 0:
          return pgm_read_byte(&reverse[0x80 + pgm_read_byte(&sinLUT[sinIndex])]);
        case 1:
          return pgm_read_byte(&reverse[0x80 + pgm_read_byte(&sinLUT[24999 - sinIndex])]);
        case 2:
          return pgm_read_byte(&reverse[0x7F - pgm_read_byte(&sinLUT[sinIndex])]);
        case 3:
          return pgm_read_byte(&reverse[0x7F - pgm_read_byte(&sinLUT[24999 - sinIndex])]);
        }
    case 2: // triangle
      switch(quadrant){
        case 0:
          return pgm_read_byte(&reverse[0x80 + int(sinIndex * triInc)]);
        case 1:
          return pgm_read_byte(&reverse[0xFF - int(sinIndex * triInc)]);
        case 2:
          return pgm_read_byte(&reverse[0x7F - int(sinIndex * triInc)]);
        case 3:
          return pgm_read_byte(&reverse[int(sinIndex * triInc)]);
        }
    default: 
      return 0xFF;
  }
}


ISR(TIMER1_COMPA_vect){
  sinIndex += frequency;
  if (sinIndex >= samplerate){
    sinIndex = sinIndex - samplerate;
    quadrant++;
    quadrant %= 4;
  }

  // PORTD = newAnalogValue();
  
  switch (type){
    case 0: // square wave
      if (quadrant < 2){
        PORTD = 0xFF;
      }
      else{
        PORTD = 0x00;
      }
      break;
    case 1: // sine
      switch (quadrant){
        case 0:
          PORTD = pgm_read_byte(&reverse[0x7F + pgm_read_byte(&sinLUT[sinIndex])]);
          break;
        case 1:
          PORTD = pgm_read_byte(&reverse[0x7F + pgm_read_byte(&sinLUT[24999 - sinIndex])]);
          break;
        case 2:
          PORTD = pgm_read_byte(&reverse[0x7F - pgm_read_byte(&sinLUT[sinIndex])]);
          break;
        case 3:
          PORTD = pgm_read_byte(&reverse[0x7F - pgm_read_byte(&sinLUT[24999 - sinIndex])]);
          break;
        }
      break;
    case 2: // triangle
      switch(quadrant){
        case 0:
          PORTD = pgm_read_byte(&reverse[int(sinIndex * triInc)]);
          break;
        case 1:
          PORTD = pgm_read_byte(&reverse[0xFF - int(sinIndex * triInc)]);
          break;
        case 2:
          PORTD = pgm_read_byte(&reverse[int(sinIndex * triInc)]);
          break;
        case 3:
          PORTD = pgm_read_byte(&reverse[0xFF - int(sinIndex * triInc)]);
          break;
        }
      break;
  }
}

void checkSettings() {
  
  if ( buttonRead() ){
    cli();
    holdInts();
    sei();
    updateLcdFunction();
    delay(5);
    cli();
    setInts();
    sei();
  }
  aState = digitalRead(ENCA);
  if ( aState != oldaState ){
    cli();
    holdInts();
    sei();
    getFreq();
    //delay(2);
    cli();
    setInts();
    sei();
  }
}

void loop()
{
  checkSettings(); // check the settings
}
